const TableData = (props) => {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios
        .get(`http://localhost:3000/${props.url}`)
        .then((response) => setData(response.data));
  }, []);

    return (
        <>
            <Table striped>
                <thead>
                    <tr >
                        <th>Name</th>
                        <th>Description</th>
                        <th>Amount $</th>
                        <th>Time</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        data?.map((value, key) => {
                            return (
                                <tr key={key}>
                                    <td>{value.name}</td>
                                    <td>{value.discription}</td>
                                    <td>{value.amount}</td>
                                    <td>{value.time}</td>
                                </tr>
                            )
                        })
                    }
                </tbody>
                {/* <div>
                <Pagination size="sm">{items}</Pagination>
                </div> */}
            </Table>
        </>
    );
}

export default TableData;
